import logo from '../img/logo.png'

class Header extends Component {
    render() { 
        return ( 
            <header>
                <div>

                </div>
                <img src={logo} alt="" />
                <input type="text" placeholder="Pesquisar" />
                <div>
                    <button id="log-in">Log In</button>
                    <button id="sign-up">Sign Up</button>
                </div>
            </header>
         );
    }
}

export default Header;
